                <img id="faction" alt={`${team}`} src="images/ui/attack.webp" />
            </div>
            <img id="portrait" alt="Ace" src="images/ops/portraits/ace.webp" />
            <img id="badge" alt="Ace" src="images/ops/icons/ace.png" />
        </div>
    )
}
